values:
I still got mardi gras hang over, i swear the gay community really know how to throw great, great parties.

it seems like everyone is coming out of their closets, bakit puro insects bah?????

on the parade- pride lebanese gay community and some of them are muslim. so proud of them
i mean they escape strict muslim upbringing to be free with their sexuality. the funniest part are the&nbsp;
"brokeback mormons" hihi, and the kate moss line dancers. oh men i love their sense of humour.&nbsp;
to my dearest mum, please rest assure that i'm not gay, i just love hanging around with them. gay&nbsp;
men KNOW cute guys.

and now, what is this thing i heard in pinoy news that rustom padilla came out of the closet in big brother house.
ohh my GOD!!!!!!!!
.....at least mayroon ng ate si robin and beauty&nbsp;consultant si carmina, shit i'm mean.
